CREATE DEFINER=`abidingg`@`localhost` PROCEDURE `PARTY_LEDGER` (IN `PARTY` INT, IN `D1` DATE, IN `D2` DATE)  BEGIN
  DECLARE label_1 VARCHAR(64);
  DECLARE label_a VARCHAR(64);
  DECLARE label_b VARCHAR(64);
  DECLARE label_c VARCHAR(64);
  DECLARE label_d VARCHAR(64);
  DECLARE label_e VARCHAR(64);
  DECLARE tem_value INT;
  DECLARE CUR_1 CURSOR FOR SELECT idparty_type FROM party WHERE idparty = PARTY;
  DECLARE CUR_2 CURSOR FOR SELECT company,name ,  mobile,       PARTY_PAID(PARTY,D1) +  PARTY_PURCHASE(PARTY,D1) as dr, -1*PARTY_RECIVED(PARTY,D1)+ PARTY_SELL(PARTY,D1) as cr FROM party LEFT JOIN client_det USING(idparty) WHERE idparty = PARTY;
  DECLARE CONTINUE HANDLER FOR NOT FOUND
  SET label_1  = "Purchase";
    OPEN CUR_1;
    REPEAT
      FETCH CUR_1 INTO tem_value ;
        UNTIL 1 = 1
    END REPEAT;
    CLOSE CUR_1;
    OPEN CUR_2;
    REPEAT
      FETCH CUR_2 INTO label_a,label_b,label_c,label_d,label_e ;
        UNTIL 1 = 1
    END REPEAT;
    CLOSE CUR_2;
    IF tem_value = 1 THEN
      SET label_1 = "Sales Return";
    END IF;
    IF tem_value = 0 THEN
      SET label_1 = "Purchase";
    END IF;
SELECT label_a,NULL,label_b,label_c,label_d,label_e UNION SELECT * FROM (
SELECT 0 as kind,idsell ,date , 'PPR Sales' ,0 as dr, total_price as cr   FROM sell s WHERE idparty =  PARTY AND type_flag = 0 AND DATE BETWEEN D1 AND D2
UNION
SELECT 0 as kind,idsell ,date , 'uPVC Sales' ,0 as dr, total_price as cr   FROM sell s WHERE idparty =  PARTY AND type_flag = 1 AND DATE BETWEEN D1 AND D2
UNION
SELECT 1 , idpurchase, date , label_1 ,total as dr, 0 as cr   FROM purchase p WHERE idparty =  PARTY  AND DATE BETWEEN D1 AND D2
UNION
SELECT 2,idtransaction ,date, 'Received By Cash', ammount as dr, 0 as cr FROM transaction WHERE idtransaction IN (SELECT idtransaction FROM transaction_party t LEFT JOIN transaction_details USING(idtransaction) WHERE idparty = PARTY AND idinfrustructure != 0 AND idinfrustructure = 1 ) AND ammount > 0  AND DATE BETWEEN D1 AND D2
UNION
SELECT 2,idtransaction ,date, 'Received By Cheuque', ammount as dr, 0 as cr FROM transaction WHERE idtransaction IN (SELECT idtransaction FROM transaction_party t LEFT JOIN transaction_details USING(idtransaction) WHERE idparty = PARTY AND idinfrustructure != 0 AND idinfrustructure != 1 ) AND ammount > 0  AND DATE BETWEEN D1 AND D2
UNION
SELECT 2, idtransaction ,date, 'Paid By Cash',  0 as dr, ammount*-1 as cr FROM transaction WHERE idtransaction IN (SELECT idtransaction FROM transaction_party t LEFT JOIN transaction_details USING(idtransaction) WHERE idparty = PARTY AND idinfrustructure != 0 AND idinfrustructure = 1 ) AND ammount < 0  AND DATE BETWEEN D1 AND D2
UNION
SELECT 2, idtransaction ,date, 'Paid By Cheuque',  0 as dr, ammount*-1 as cr FROM transaction WHERE idtransaction IN (SELECT idtransaction FROM transaction_party t LEFT JOIN transaction_details USING(idtransaction) WHERE idparty = PARTY AND idinfrustructure != 0 AND idinfrustructure != 1 ) AND ammount < 0  AND DATE BETWEEN D1 AND D2
ORDER BY date, kind
) as a;
END$$

