CREATE DEFINER=`abidingg`@`localhost` PROCEDURE `STAFF_FULL_EVALUATION` (IN `ID` INT)  BEGIN
  DECLARE STAFF_NAME VARCHAR(64);
  DECLARE CUR_1 CURSOR FOR SELECT name FROM staff WHERE idstaff = ID;
  DECLARE CONTINUE HANDLER FOR NOT FOUND
  SET STAFF_NAME = '';
    OPEN CUR_1;
    REPEAT
      FETCH CUR_1 INTO STAFF_NAME;
        UNTIL 1 = 1
    END REPEAT;
    CLOSE CUR_1;
SELECT STAFF_NAME,idparty,name,SUM(purchased),sum(paid),sum(com) FROM (
SELECT * FROM (SELECT
  idparty,SUM(ammount - (ammount/100)*discount)as purchased , 0 as paid, 0 as com      FROM
    (SELECT idsell, idparty, SUM(ammount*price) as ammount, discount
        FROM
          (SELECT idstaff,idparty,idsell,discount
              FROM
                  (SELECT * FROM sell_details WHERE idstaff = ID) as sd
                  LEFT JOIN
                  sell
                  USING(idsell)
                  ) as sd
                  LEFT JOIN
                  sell_stock_outupt as sso
                  USING(idsell)
                  LEFT JOIN
                  infrustructure_stock_output iso
                  ON
                  sso.idstock_output = iso.idinfrustructure_stock_output
                  GROUP BY idsell) as a
  GROUP BY idparty
) as a
UNION
SELECT idparty, 0 as purchased,SUM(ammount) as paid,SUM(total) as com FROM
   (SELECT idtransaction,total FROM
        transaction_commission WHERE idstaff = ID) as a
   LEFT JOIN
   `transaction`
   USING(idtransaction)
   LEFT JOIN
   `transaction_party`
   USING(idtransaction)
  GROUP BY idparty
) as a LEFT JOIN party USING(idparty) GROUP BY idparty;
END$$

