CREATE DEFINER=`abidingg`@`localhost` PROCEDURE `STOCK_STATEMENT` (IN `D1` DATE, IN `D2` DATE)  BEGIN
SELECT * FROM(
SELECT * FROM(
  SELECT idproduct,sum(ammount) AS input FROM (
    SELECT idproduct,0 as buff FROM product
  ) as a
  LEFT JOIN
  (
    SELECT idproduct,ammount FROM infrustructure_stock_input WHERE date < D1
  )
  as b
  USING(idproduct)
  GROUP BY idproduct
) as a
LEFT JOIN
(
SELECT * FROM(
  SELECT idproduct,SUM(ammount) as output FROM (
    SELECT idproduct,0 as buff FROM product
  ) as a
  LEFT JOIN
  (
    SELECT idproduct,ammount FROM infrustructure_stock_output WHERE date < D1
  )
  as b
  USING(idproduct)
  GROUP BY idproduct
) as b ) as c USING(idproduct)
) as opening_stock
LEFT JOIN
(
SELECT idproduct, ammount as pruchase_quantity, SUM(ammount*price) as pruchase_price FROM (
SELECT idpurchase FROM
(SELECT * FROM purchase WHERE date BETWEEN D1 AND D2) as a
LEFT JOIN
party USING(idparty) WHERE idparty_type = 0
) as a
LEFT JOIN purchase_stock_input as psi USING(idpurchase)
LEFT JOIN infrustructure_stock_input as isi ON psi.idstock_input = isi.idinfrustructure_stock_input
GROUP BY idproduct
) AS purchase USING(idproduct)
LEFT JOIN
(
SELECT idproduct,SUM(ammount) as sales_ammount, SUM(ammount * (price - ((price/100)*fittings))) as sales_price  FROM
(
  SELECT idsell,discount_1 as fittings, discount_2 as pipe FROM sell s WHERE date BETWEEN D1 AND D2
) as a
LEFT JOIN
sell_stock_outupt as sso USING(idsell)
LEFT JOIN
infrustructure_stock_output iso ON sso.idstock_output = iso.idinfrustructure_stock_output
LEFT JOIN
product USING(idproduct) WHERE status = 0
GROUP BY idproduct
UNION
(
SELECT idproduct,SUM(ammount) as sales_ammount, SUM(ammount * (price - ((price/100)*pipe))) as sales_price  FROM
(
  SELECT idsell,discount_1 as fittings, discount_2 as pipe FROM sell s WHERE date BETWEEN D1 AND D2
) as a
LEFT JOIN
sell_stock_outupt as sso USING(idsell)
LEFT JOIN
infrustructure_stock_output iso ON sso.idstock_output = iso.idinfrustructure_stock_output
LEFT JOIN
product USING(idproduct) WHERE status = 1
GROUP BY idproduct
)
) as sales USING(idproduct)
LEFT JOIN
(
SELECT idproduct, ammount as return_ammount, SUM(ammount*price) as return_price FROM (
SELECT idpurchase FROM
(SELECT * FROM purchase WHERE date BETWEEN D1 AND D2) as a
LEFT JOIN
party USING(idparty) WHERE idparty_type = 1
) as a
LEFT JOIN purchase_stock_input as psi USING(idpurchase)
LEFT JOIN infrustructure_stock_input as isi ON psi.idstock_input = isi.idinfrustructure_stock_input
GROUP BY idproduct
) as purchase_return USING(idproduct)
LEFT JOIN
(
SELECT idproduct, product_name, mrp,stage FROM SHOW_STOCK WHERE (stage = 1 AND idinfrustructure = 2) OR (stage = 2 AND idinfrustructure = 3)
) as name
USING(idproduct) ORDER BY product_name;
END$$

CREATE DEFINER=`abidingg`@`localhost` PROCEDURE `TRANSACTION_DETAILS` (IN `ID` INT)  BEGIN
DECLARE transaction_type INTEGER;
DECLARE transaction_status  BOOLEAN;
DECLARE transaction_typ_str VARCHAR(64);
DECLARE transaction_with VARCHAR(64);
DECLARE transaction_with_id SMALLINT;
DECLARE transaction_date VARCHAR(15);
DECLARE transaction_ammount DOUBLE;
DECLARE transaction_method SMALLINT;
DECLARE transaction_comments VARCHAR(512);
DECLARE idinf INT;
DECLARE transaction_location VARCHAR(64);
DECLARE ch_bank VARCHAR(64);
DECLARE ch_ac VARCHAR(64);
DECLARE ch_date VARCHAR(20);
DECLARE ch_branch VARCHAR(64);
DECLARE id_commission_sallary INT;
DECLARE id_staff INT;
DECLARE comission_reciver VARCHAR(64);
DECLARE comission_per DOUBLE;
DECLARE comission_tot DOUBLE;
DECLARE ac_balance DOUBLE;
DECLARE tem_v VARCHAR(64);
DECLARE head  VARCHAR(64);
DECLARE CUR_1 CURSOR FOR SELECT name, idexpense, paidto FROM (SELECT idexpense, `for` as paidto FROM transaction_expense WHERE idtransaction = ID) as a LEFT JOIN expense USING(idexpense);
DECLARE CUR_4 CURSOR FOR SELECT CONCAT(company  , " : ID - ", idparty+100),idparty FROM client_det WHERE idparty IN (SELECT idparty FROM     transaction_party WHERE idtransaction = ID);
DECLARE CUR_11 CURSOR FOR SELECT CONCAT(comission_reciver_name),idcomission_reciver FROM comission_reciver as r  LEFT JOIN client_det c ON c.idparty = r.idcompany WHERE idcomission_reciver IN (SELECT idcomission_reciver FROM     transaction_comission_reciver WHERE idtransaction = ID);
DECLARE CUR_7 CURSOR FOR SELECT idstaff_sallary,idstaff,name,comission,total FROM (SELECT * FROM transaction_commission WHERE idtransaction = ID) as a LEFT JOIN staff USING(idstaff);
DECLARE CUR_5 CURSOR FOR SELECT name,idpropiter FROM propiter WHERE idpropiter IN (SELECT idpropiter FROM transaction_propiter WHERE idtransaction = ID);
DECLARE CUR_6 CURSOR FOR SELECT name,idstaff FROM staff WHERE idstaff IN (SELECT idstaff FROM transaction_staff WHERE idtransaction = ID);
DECLARE CUR_2 CURSOR FOR SELECT date,ammount,idtype,comments, head_name FROM `transaction` LEFT JOIN transaction_head USING(idtransaction) LEFT JOIN head USING(idhead) WHERE idtransaction = ID;
DECLARE CUR_3 CURSOR FOR SELECT status,CONCAT(i.name, ' : ',location), date,bank,a.ac,a.branch  ,idinfrustructure,sum(ammount)    FROM (SELECT * FROM transaction_details WHERE idtransaction = ID) as a LEFT JOIN infrustructure as i USING(idinfrustructure) LEFT JOIN infustructure_money as im USING(idinfrustructure);
DECLARE CUR_9 CURSOR FOR SELECT name,idparty FROM party WHERE idparty IN (SELECT idparty FROM transaction_loan WHERE idtransaction = ID);
DECLARE CONTINUE HANDLER FOR NOT FOUND
SET transaction_status  = true;
SET transaction_typ_str = NULL;
SET transaction_with = NULL;
SET transaction_with_id = NULL;
SET transaction_location = NULL;
SET ch_bank = NULL;
SET ch_ac  = NULL;
SET ch_date = NULL;
SET ch_branch = NULL;
SET idinf = NULL;
SET id_commission_sallary = NULL;
SET id_staff = NULL;
SET comission_reciver = NULL;
SET comission_per = NULL;
SET comission_tot = NULL;
SET ac_balance = 0.0;
/* Expense */
  IF((SELECT count(*) FROM transaction_expense where idtransaction = ID  ) > 0) THEN
    SET transaction_type = 1;
    SET transaction_typ_str = "For Expense";
    OPEN CUR_1;
    REPEAT
      FETCH CUR_1 INTO transaction_with,transaction_with_id , tem_v ;
        UNTIL 1 = 1
    END REPEAT;
    CLOSE CUR_1;
    SET transaction_typ_str = transaction_with;
    SET transaction_with = tem_v;
  END IF;
/* transaction for external commission */
  IF((SELECT count(*) FROM transaction_comission_reciver where idtransaction = ID  ) > 0) THEN
    SET transaction_type = 11;
    SET transaction_typ_str = "Sales Commission";
    OPEN CUR_11;
            REPEAT
      FETCH CUR_11 INTO transaction_with,transaction_with_id      ;
        UNTIL 1 = 1
    END REPEAT;
    CLOSE CUR_11;
  END IF;
/* transaction with party */
  IF((SELECT count(*) FROM transaction_party where idtransaction = ID  ) > 0) THEN
    SET transaction_type = 2;
    SET transaction_typ_str = "With Party";
    OPEN CUR_4;
            REPEAT
      FETCH CUR_4 INTO transaction_with,transaction_with_id      ;
        UNTIL 1 = 1
    END REPEAT;
    CLOSE CUR_4;
    OPEN CUR_7;
      REPEAT
      FETCH CUR_7 INTO id_commission_sallary,id_staff,comission_reciver,comission_per,comission_tot;
        UNTIL 1 = 1
    END REPEAT;
    CLOSE CUR_7;
  END IF;
  IF((SELECT count(*) FROM transaction_loan where idtransaction = ID  ) > 0) THEN
    SET transaction_type = 9;
    SET transaction_typ_str = "For Loan";
    OPEN CUR_9;
            REPEAT
      FETCH CUR_9 INTO transaction_with,transaction_with_id      ;
        UNTIL 1 = 1
    END REPEAT;
    CLOSE CUR_9;
  END IF;
/* transaction with propiter */
  IF((SELECT count(*) FROM transaction_propiter where idtransaction = ID  ) > 0) THEN
    SET transaction_type = 3;
    SET transaction_typ_str = "With Propiter";
    OPEN CUR_5;
    REPEAT
      FETCH CUR_5 INTO transaction_with,transaction_with_id      ;
        UNTIL 1 = 1
    END REPEAT;
    CLOSE CUR_5;
  END IF;
/* transaction with staff */
  IF ((SELECT count(*) FROM transaction_staff where idtransaction = ID  ) > 0) THEN
    SET transaction_type = 4;
    SET transaction_typ_str = "With Staff";
    OPEN CUR_6;
    REPEAT
      FETCH CUR_6 INTO transaction_with,transaction_with_id      ;
        UNTIL 1 = 1
    END REPEAT;
    CLOSE CUR_6;
  END IF;
  OPEN CUR_2;
    REPEAT
      FETCH CUR_2 INTO transaction_date,transaction_ammount,transaction_method,transaction_comments, head;
          UNTIL 1 = 1
    END REPEAT;
  CLOSE CUR_2;
    OPEN CUR_3;
    REPEAT
      FETCH CUR_3 INTO transaction_status ,transaction_location,ch_date,ch_bank,ch_ac,ch_branch,idinf,ac_balance;
          UNTIL     1 = 1
    END REPEAT;
    CLOSE CUR_3;
  IF transaction_type != 3 AND transaction_type !=9 AND transaction_type != 11 THEN
    SET transaction_typ_str = head;
  END IF;
  SELECT transaction_status,transaction_type, transaction_typ_str,transaction_with_id,transaction_with,transaction_date,transaction_ammount,transaction_comments,  idinf ,transaction_location,transaction_method,  ch_date,ch_bank,ch_ac,ch_branch,id_commission_sallary,id_staff,comission_reciver,comission_per,comission_tot,ac_balance,head;
END$$

