CREATE DEFINER=`abidingg`@`localhost` FUNCTION `PARTY_PAID` (`ID` INT, `D1` DATE) RETURNS DOUBLE BEGIN
  DECLARE OUTPUT DOUBLE;
  IF D1 = '0000-00-00'  OR D1 IS NULL    THEN
    SELECT SUM(ammount) INTO OUTPUT FROM (SELECT idtransaction FROM transaction_party WHERE idparty = ID) as a LEFT JOIN transaction USING(idtransaction) LEFT JOIN transaction_details USING(idtransaction) WHERE idinfrustructure != 0 AND ammount > 0;
  ELSE
    SELECT SUM(ammount) INTO OUTPUT FROM (SELECT idtransaction FROM transaction_party WHERE idparty = ID) as a LEFT JOIN transaction as t USING(idtransaction) LEFT JOIN transaction_details USING(idtransaction) WHERE idinfrustructure != 0 AND t.date < D1 AND ammount > 0 ;
  END IF;
  RETURN IFNULL(OUTPUT,0)    ;
  END$$

CREATE DEFINER=`abidingg`@`localhost` FUNCTION `PARTY_PURCHASE` (`ID` INT, `D1` DATE) RETURNS DOUBLE BEGIN
  DECLARE OUTPUT DOUBLE;
  IF D1 = '0000-00-00' OR D1 IS NULL THEN
    SELECT SUM(total) INTO OUTPUT FROM purchase WHERE idparty = ID;
  ELSE
    SELECT SUM(total) INTO OUTPUT FROM purchase WHERE idparty = ID AND date   < D1  ;
  END IF;
  RETURN IFNULL(OUTPUT,0);
  END$$

CREATE DEFINER=`abidingg`@`localhost` FUNCTION `PARTY_RECIVED` (`ID` INT, `D1` DATE) RETURNS DOUBLE BEGIN
  DECLARE OUTPUT DOUBLE;
  IF D1 = '0000-00-00'  OR D1 IS NULL    THEN
    SELECT SUM(ammount) INTO OUTPUT FROM (SELECT idtransaction FROM transaction_party WHERE idparty = ID) as a LEFT JOIN transaction USING(idtransaction) LEFT JOIN transaction_details USING(idtransaction) WHERE idinfrustructure != 0 AND ammount < 0;
  ELSE
    SELECT SUM(ammount) INTO OUTPUT FROM (SELECT idtransaction FROM transaction_party WHERE idparty = ID) as a LEFT JOIN transaction as t USING(idtransaction) LEFT JOIN transaction_details USING(idtransaction) WHERE idinfrustructure != 0 AND t.date < D1 AND ammount < 0 ;
  END IF;
  RETURN IFNULL(OUTPUT,0)    ;
  END$$

CREATE DEFINER=`abidingg`@`localhost` FUNCTION `PARTY_SELL` (`ID` INT, `D1` DATE) RETURNS DOUBLE BEGIN
  DECLARE OUTPUT DOUBLE;
  IF D1 = '0000-00-00' OR D1 IS NULL THEN
    SELECT SUM(total_price) INTO OUTPUT FROM sell WHERE idparty = ID;
  ELSE
    SELECT SUM(total_price) INTO OUTPUT FROM sell WHERE idparty = ID AND date   < D1  ;
  END IF;
  RETURN IFNULL(OUTPUT,0);
  END$$

CREATE DEFINER=`abidingg`@`localhost` FUNCTION `PRODUCT_INPUT` (`ID` INT) RETURNS INT(11) BEGIN
  DECLARE input INT;
  SELECT SUM(ammount) into input FROM infrustructure_stock_input WHERE idproduct = ID;
  RETURN input;
END$$

CREATE DEFINER=`abidingg`@`localhost` FUNCTION `PRODUCT_OUTPUT` (`ID` INT) RETURNS INT(11) BEGIN
  DECLARE output INT;
  SELECT SUM(ammount) into output FROM infrustructure_stock_output WHERE idproduct = ID;
  RETURN output;
END$$

